West Farms Road, west side, north from near Jennings Street to E. 172nd Street, showing old homes in the former village of West Farms on the Bronx River. These probably date back to Revolutionary times nad are the last remaining old homes in this arsa. The immediate foreground in this view marks the boundry between the 23rd and 24th wards;

E. P. Chrystie

April 16, 1927
